export const getAnagram = (string1, string2) => {
  const letters1 = string1
    .toLowerCase()
    .replace(/[^a-z0-9]/gi, "")
    .split("");
  const letters2 = string2
    .toLowerCase()
    .replace(/[^a-z0-9]/gi, "")
    .split("");

  let letterCount = {};
  letters1.forEach((letter) => {
    if (!letterCount[letter]) {
      letterCount[letter] = 1;
    } else {
      letterCount[letter] += 1;
    }
  });
  letters2.forEach((letter) => {
    if (letterCount[letter]) {
      letterCount[letter] -= 1;
    }
  });
  return letterCount;
};
